__p += '<section>\r\n\r\n    <!-- Learning Experience -->\r\n    <section id="top-separator" class="container-fluid le-area">\r\n        <div class="container le-content">\r\n            <div class="row text-left">\r\n                <div class="col-md-6 col-sm-7 col-xs-7 col-xs-offset-1">\r\n                    <h2 class="inverted">LEARNING EXPERIENCE</h2>\r\n                    <img src="images/line_title_w.jpg">\r\n\r\n                    <h3 class="ligth">O que nos move.</h3>\r\n\r\n                    <p class="inverted">Por que viajamos a novos lugares, experimentamos novas comidas, registramos em fotos e vídeos diferentes momentos de nossas vidas? Fazemos isso para vivenciar e relembrar boas experiências.\r\n                        <br>\r\n                        <br>Experimentar, interagir e vivenciar o conhecimento, é sem dúvida alguma a maneira mais eficiente de se aprender algo.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="container le-featured text-center">\r\n                <div class="row">\r\n                    <p class="inverted">Focamos nas pessoas para criar materiais relevantes, que sejam interessantes para os usuários.\r\n                        <br>Fluídos, como uma conversa, intuitiva e dinâmica. Que ofereça um retorno real e tangível, como uma boa lembrança.\r\n                        <br>\r\n                        <br>Estas são as características que a UNBOX leva em consideração para criar soluções de ensino para sua empresa. Criando boas experiências para quem as usa. Esta é a nossa bandeira, isso é Learning Experience.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </section>\r\n\r\n    <!-- Unbox -->\r\n    <section class="unbox-area container text-center">\r\n        <img src="images/unbox_top.jpg"/>\r\n\r\n        <div class="padding-top-unbox">\r\n            <h2 class="inverted">UNBOX</h2>\r\n            <img src="images/line_title_w.jpg">\r\n        </div>\r\n\r\n        <div class="container">\r\n            <br>\r\n\r\n            <div id="unbox-carousel" class="carousel slide" data-ride="carousel">\r\n                <!-- Wrapper for slides -->\r\n                <!-- Indicators -->\r\n                <ol class="carousel-indicators">\r\n                    <li data-target="#unbox-carousel" data-slide-to="0" class="active"></li>\r\n                    <li data-target="#unbox-carousel" data-slide-to="1"></li>\r\n                    <li data-target="#unbox-carousel" data-slide-to="2"></li>\r\n                </ol>\r\n\r\n                <div class="carousel-inner" role="listbox">\r\n\r\n                    <div class="item active">\r\n                        <div class="carousel-content">\r\n                            <div class="row">\r\n                                <h4 class="inverted"><strong>Uma empresa comprometida com o aprendizado.</strong></h4>\r\n\r\n                                <p class="featured">A UNBOX é uma empresa de Curitiba que atua a 6 anos no desenvolvimento de treinamentos corporativos.\r\n                                    <br> Diferente da grande maioria do mercado, nossa experiência com a área instructional se iniciou nas áreas de comunicação e tecnologia.\r\n                                    <br> Estes conhecimentos nos permitem explorar novas possibilidades, criando caminhos de aprendizagem ricos e elaborados, com uma linguagem de fácil assimilação e próxima para o usuário, de forma interativa e estimulante.\r\n                                </p>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="item">\r\n                        <div class="carousel-content">\r\n                            <div class="row">\r\n                                <h4 class="inverted"><strong>Diferentes culturas, diferentes experiências.</strong></h4>\r\n\r\n                                <p class="featured">A UNBOX busca sempre a aproximação e o contato com nossos clientes.\r\n                                    <br>Este contato nos traz um real entendimento da cultura da empresa, das pessoas que a compõe e suas necessidades.\r\n                                    <br>Este relacionamento gera um agradável engajamento e ótimos resultados.</p>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="item">\r\n                        <div class="carousel-content">\r\n                            <div class="row">\r\n                                <h4 class="inverted"><strong>A tecnologia a favor da educação.</strong></h4>\r\n\r\n                                <p class="featured">O uso inteligente da tecnologia tem um papel fundamental nos projetos da UNBOX.\r\n                                    <br>Estamos sempre explorando as novas possibilidades que surgem a cada dia e mais importante que isso, fazemos um uso consciente destes recursos tecnológicos, pois estes devem estar alinhados ao contexto de cada cliente.\r\n                                </p>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n\r\n                </div>\r\n\r\n                <!-- Left and right controls -->\r\n\r\n                <!--\r\n                <a class="left carousel-control" href="#myCarousel" role="button" data-slide="prev">\r\n                    <span class="glyphicon glyphicon-chevron-left" aria-hidden="true"></span>\r\n                    <span class="sr-only">Previous</span>\r\n                </a>\r\n                <a class="right carousel-control" href="#myCarousel" role="button" data-slide="next">\r\n                    <span class="glyphicon glyphicon-chevron-right" aria-hidden="true"></span>\r\n                    <span class="sr-only">Next</span>\r\n                </a>\r\n            -->\r\n            </div>\r\n        </div>\r\n    </section>\r\n\r\n</section>';

